import React, { Component } from 'react';

class Form extends Component {



  render() {
    return (
      <>
        <span>Meu formulário</span>
        <form>
          <fieldset>
              <div>
              <label for='name'>Nome</label>
              <input type='text' name='name' id='name' maxLength='40' required></input>
              </div>
              <div>
              <label for='email'>Email:</label>
              <input class="email-input" type="email" name='email' id='email' maxlength='50' required></input>
              </div>
          </fieldset>
        </form>
      </>
    );
  }
}

export default Form;
